// SPDX-License-Identifier:MIT
pragma solidity ^0.6.0;
interface Reentrance{
    function donate(address) external payable;
}
contract hh {
    Reentrance rr= Reentrance(0x14E4c94E546297B471f23EBFd97618a7983d2B9C);
    function jbaw(address _lapp) public{
        (bool jj, bytes memory ll) = address(rr).call{value:100000000000000}(abi.encodeWithSignature("donate(address)", _lapp));
    }
}

